          <p>marcas</p>
        </div>
        <div className="whatsOn">
          <img src={whats} alt="Calendario" />
          <p>what's on</p>
        </div>

        <div className="HappyGuiri">
          <img src={HappyGuiri} alt="Bolsa Sostenible" />
          <p>Happy Stylers</p>
        </div>
      </div>
    </main>
  );
};

export default Menu;
